public class FindOdds {

	public static void main(String[] args) {
		int[] freq = new int[26];
		String s = "2110#(2)";
		char[] code = s.toCharArray();
		int numR = 0, numL = 0, count = 0, num;
		boolean flag = true;
		for (int i = code.length - 1; i >= 0; --i) {
			if (code[i] == ')') {
				flag = false;
				numR = i;
			} else if (code[i] == '(') {
				numL = i + 1;
				count = Integer.parseInt(s.substring(numL, numR));
				flag = true;
			} else if (code[i] == '#') {
				num = Integer.parseInt(s.substring(i - 2, i));
				i = i - 2;
				updateFreq(freq, num - 1, count);
			} else {
				if (flag) {
					count = 1;
					num = Integer.parseInt(s.substring(i, i + 1));
					updateFreq(freq, num - 1, count);
				}
			}
		}
		for (int i : freq) {
			System.out.print(i + " ");
		}

	}

	static void updateFreq(int[] freq, int num, int count) {
		freq[num] += count;
	}

}

